  async changeCohortDetail(cohortDetail, user) {
    let mddProfileDisplayed = await this.ddProfile.isClickable();

    if (!mddProfileDisplayed) {
      await browser.reloadSession();
      await _LoginPage.default.loginToLearnPortal(user);
    } // await browser.pause(5000)//Waiting for the page to load completely


    await this.ddProfile.waitForClickable({
      timeout: 15000
    });
    await this.ddProfile.click();
    await this.btnProfile.waitForClickable({
      timeout: 15000
    });
    await this.btnProfile.click();
    await this.ddcohortSelection.waitForClickable({
      timeout: 15000
    });
    await this.ddcohortSelection.click();
    await browser.keys(cohortDetail);
    await browser.keys('Tab');
    await browser.pause(6000);
    await $("//*[@class='font-12 account-position']").waitUntil(async function () {
      return (await $("//*[@class='font-12 account-position']").getText()).toLowerCase().includes(cohortDetail.toLowerCase());
    }, {
      timeout: 15000,
      timeoutMsg: 'Cohort not changed to the expected cohort'
    });

    try {
      await this.btnskipTour.waitForDisplayed({
        timeout: 7500
      });
    } catch {}

    let skipTourDisplayed = await this.btnskipTour.isDisplayed({
      timeout: 7500
    });

    if (skipTourDisplayed) {
      await this.btnskipTour.waitForClickable({
        timeout: 9000
      });
      await this.btnskipTour.click();
    }

    let bookTrailWindowDisplayed = await this.bookTrailWindow.isDisplayed({
      timeout: 5000
    });

    if (bookTrailWindowDisplayed) {
      await this.bookTrailWindow.waitForDisplayed({
        timeout: 5000
      });
      await browser.refresh();

      try {
        await this.ddProfile.waitForClickable({
          timeout: 3000
        });
      } catch {}
    }

    for (let i = 0; i < 25; i++) {
      try {
        await $("//*[text()='Explore']").waitForDisplayed({
          timeout: 200
        });

        if (await $("//*[text()='Explore']").isDisplayed()) {
          break;
        } else {
          await $(`//*[text()="BYJU'S World of Learning"]`).waitForDisplayed({
            timeout: 200
          });

          if (await $(`//*[text()="BYJU'S World of Learning"]`).isDisplayed()) {
            break;
          }
        }
      } catch {}
    }
  }

