    let failedKey
    for (let i = 0; i < keysOfLocalData.length; i++) {
        if (localData[eventID][keysOfLocalData[i]] == cloudWatchData[eventID][keysOfLocalData[i]]) {
            console.log("Key matched for '" + keysOfLocalData[i] + "'")
